import Slide from "./Components/Slide";
import "./styles/global.css"

function App() {
  return (
    <Router>
    <Navbar/>
    <Routes>
      <Route path="/formulario" element={<Slides />} />
      <Route path="/proposta" element={<FormularioExibicao />} />
    </Routes>
  </Router>  );
}

export default App;
